import React from 'react';

import styles from './Appointment.module.css';

import AppointmentItem from '../AppointmentItem/AppointmentItem';

const BASE_URL = "http://back-q-doctor.herokuapp.com/api"
const APPOINTMENT_URL = "/people/appointments"


export default class Appointment extends React.Component {
	constructor(props) {
		super(props);

		this.state = {appointments: []}
	}

	fetchAppointments(oms_number, birth_date) {
		// return fetch(BASE_URL+APPOINTMENT_URL+`?oms_number=${oms_number}&birth_date=${birth_date}`, {
		// 								method: 'GET',
		// 								headers: {
		// 									'Content-Type': 'application/json',
		// 								},
		// 							 })

									 fetch('http://back-q-doctor.herokuapp.com/api/people/appointments?oms_number=5051200820001900&birth_date=1997-08-29', {method: 'GET', headers: {
										'Content-Type': 'application/json',
									},})
						.then(response => {console.log(response); response.json();})
						.then(response => {console.log(response); return response;})
						.then(response => this.setState({ ...this.state,
																						 appointments: response,
																						}));
	}

	componentDidMount() {
		this.fetchAppointments(this.props.omsNumber, this.props.birthDate);
	}

  render() {
		return (
			<ul className={styles.items}>
				{this.state.appointments.map(appointment => <AppointmentItem appointment={appointment}/>)}
			</ul>
		);
	};
};
